                                 OfflineService,
                                 UserAgent,
                                 $window,
                                 $sce,
                                 $location,
                                 $state,
                                 $notify,
                                 JadeV1Scheme,
                                 JadeV2Scheme,
                                 CatalogService,
                                 SearchService,
