    'use strict';

    this.CLIENT_BROWSER = "BROWSER";
    this.VIEW_APP_TYPES = ["VIEWPOOL", "VIEWAPP"];
    this.XEN_APP_TYPES = ["XENAPP", "XENAPPDELIVERYGROUP"];
