                return Resource(url, {
                    headers: {
                        'Content-Type': 'application/vnd.vmware.catalog.user.event-create-v1+json',
                        'Accept': 'application/vnd.vmware.catalog.user.event-create-confirmation-v1-hal+json',
                        'method': 'POST'
                    }
                }).postResource('{"action": "' + action + '", "eventData": { "appId" : "' + appId + '"}}');
